import React, { Component } from 'react';
import "./index.css";

class About extends Component {
  render() {
    return (
      <div className="aboutDiv">
        <p><span>Theme:</span>&nbsp;"Perseverance"</p>
        <p>The story of Jesus is sometimes called the greatest love story ever told. Christians who know
          of the love of Christ are called to live a life resembling His. This brings up an important question:
          What is this love story and what does it look like to live in this story? Please join us as we attempt to
          answer this question so that we may learn to love like Christ loved.
        </p>
      </div>
    )
  };
};

export default About;
